import React,{useState,useEffect} from 'react';
import {
  View,
  Text,
} from 'react-native';
function Succsess() {
  return (
    <View>
      <Text className="icon">
        Succuss
      </Text>
      <Text className="icon">
        Thank You for your order!
      </Text>
      <Text className="icon">
        Succuss
      </Text>
      <Text className="icon">
        Succuss
      </Text>
    </View>
  )
}

export default Succsess;
